import React, {Component} from "react"; 
import "./Jumbo.css";
import Particles from 'react-particles-js';




class Jumbo extends Component {
    render(){
        return (

            <div className="Jumbo">
                <Particles
                className="Particles-background"
                params={{
                    "particles": {
                        "number": {
                            "value": 50
                        },
                        "size": {
                            "value": 2
                        }
                    },
                    "interactivity": {
                        "events": {
                            "onhover": {
                                "enable": true,
                                "mode": "repulse"
                            }
                        }
                    }
                }} />
                <h1 className="Jumbo-title">JP Luncumilla</h1>
            </div>
        )
    }
}

export default Jumbo;
